import React from "react";
import '../SelectDrop/select.css'


const Select =()=> {
    return(
        <div className="selectedDrop">
            <div className="searchField">
                <input type="text"/>
                <ul>
                    <li>New & Featured</li>
                    <li>Men</li>
                    <li>Women</li>
                    <li>Kids</li>
                    <li>Sale</li>
                </ul>
            </div>
        </div>
    )
}
export default Select;
